import React from 'react'


function Footer (props) {

    return (
        <footer id="footer" aria-labelledby="aria-footer">
            <label id="aria-footer" className="aria-label">Footer: Copyright Statement</label>
            Copyright (c) 2018 <a href="/"><strong>Lake Tahoe Ski Resorts Map</strong></a> All Rights Reserved.
        </footer>
    );
}

export default Footer
